import React from 'react';
import { Link } from "react-router-dom";

const Navigatebar= () =>{
  return (
    <div classname="nav-bar">
      <li>
        <Link to="/">Menu</Link>
      </li>
      <li>
        <Link to="/">Menu2</Link>
      </li>
    </div>
  );
}
export default Navigatebar;
